import React, { useState } from 'react';
import TxELogo from '../../assets/txeLogo.svg';
import { Icon } from '../../icons/Icons';

const Navbar = () => {
  const [showMenu, setShowMenu] = useState(false);

  const handleMenuToggle = () => {
    setShowMenu(!showMenu);
  };

  return (
    <div className='flex justify-center items-center space-x-44 p-4'>
      <div>
        <img src={TxELogo} alt="" />
      </div>
      <div className='relative'>
        <ul className={`md:flex space-x-20 ${showMenu ? 'block' : 'hidden'}`} onClick={handleMenuToggle}>
          <li>About</li>
          <li>Achievements</li>
          <li>Speakers</li>
          <li>EventSchedule</li>
        </ul>
        {/* small devices */}
        <div className='md:hidden text-2xl font-semibold' onClick={handleMenuToggle}>
          <Icon.BarMenu />
        </div>
      </div>
    </div>
  );
};

export default Navbar;
